import React from 'react';

const BackButton=()=>{
    nextPath=(path)=>{
        this.props.history.push(path);
    }
     return(
        <div>
            <button 
                style={{marginTop:"50px" }}
                className="ui button"
                onClick={()=>this.nextPath('/')}>
                    Back
            </button>   
        </div>
     )

}

export default BackButton;
